    <script defer>
      function moveCubes(direction, pixels) {
        // Select all the rect elements within the <g> group
            console.log("YIPPIIII")
        const rects = document.querySelectorAll("g rect");

        // Initialize a counter to track the incremental movement
        let increment = 0;

        // Loop through each rect element and adjust the position
        rects.forEach((rect, index) => {
          // Get the current x and y position
          let x = parseInt(rect.getAttribute("x"));
          let y = parseInt(rect.getAttribute("y"));
          
          // Increment the movement based on the index (index starts at 0)
          if (direction === "x") {
            rect.setAttribute("x", x + (x/30)); // Increment by (index + 1) times the pixels
          } else if (direction === "y") {
            rect.setAttribute("y", y + (y/30)); // Same logic for y direction
          }
        });
      }
      document.addEventListener("DOMContentLoaded", function () {
        moveCubes("x", 1);
        moveCubes("y", 3);
      });
    </script>
